<script>
    function setUserAgent1(userAgent) {
        if (navigator.userAgent != userAgent) {
            var userAgentProp = { get: function () { return userAgent; } };
            try {
                Object.defineProperty(navigator, 'userAgent', userAgentProp);
                Object.defineProperty(navigator.userAgentData, 'mobile', userAgentProp);
            } catch (e) {
                navigator = Object.create(navigator, {
                    userAgent: userAgentProp
                });
            }
        }
    }

    // setUserAgent1("Mozilla/5.0 (Windows NT 10.0; WOW64; rv:70.0) Gecko/20100101 Firefox/70.0");

</script>
